  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {
  baseUrl : String = 'http://localhost:1010'
  searchedQueryParams : String = ''
  searchInput:String = ''
